    <style>
    html, body, table {

    h1, h2 , h3, h4, h5 {

        margin-left: 15px;

        td, th {
            white-space: nowrap;
        }

    .caption {
        text-align: center;
        font-size: 90%;

    img {
        display: block;
        margin: auto;

        width: 1em;

    .textwrapper {
        padding: 15px;

    div.normal textarea:invalid {

    }

    div.selected textarea {
        display: block;
    }

    @media print{
        section.section, img {
            page-break-inside: avoid;
        }
    }
